import React from 'react';
import Card from './Card';
import '../containers/App.css';

const CardList = ({ items,region }) => {
  return (
    items.map((item, i) => {
      const info = items[i][1]
      return (
        <Card
          key={i}
          id={info.id-1}
          name={info.name['name-CNzh']}
          price={info.price}
          time={info.availability.time}
          month={info.availability[region]}
          region={region}
          />
          );
    })
    );
}

export default CardList;
